        oRespuestaCotizacionAutoDTO = responseHttp.Response;





        oCotizacionAutoDTO.cotizacionID = oRespuestaCotizacionAutoDTO.cotizacionID;


        CotizacionAutoDTOJson = JsonSerializer.Serialize(oCotizacionAutoDTO);
